import React, { useState } from 'react';
import axios from 'axios';
import Table from '../../Components/Table';

const VisualizarProcedimentos: React.FC = () => {
  const [nome, setNome] = useState<string>('');
  const [valor, setValor] = useState<string>('');
  const [descricao, setDescricao] = useState<string>('');
  const [tipoProcedimento, setTipoProcedimento] = useState<number>(1);
  const [imagem, setImagem] = useState<File | null>(null);

  const handleClickCadastro = () => {
    console.log('Cadastro');

    const filter = {
      nome,
      descricao,
      valor,
      inserirArquivo: imagem,
      tipoProcedimento,
    }

    console.log(filter)

    const apiUrl = 'http://localhost:5082/api/Procedimento';

    axios.get(apiUrl)
      .then((response) => {
        console.log(response.data)
      })
      .catch((error) => {
        console.error('Erro ao cadastrar procedimento:', error);
      });

  };

  interface TableRow {
    [key: string]: any;
  }

  const dados: TableRow[] = [
    {nome: 'Item 1', preco: 10 },
    {nome: 'Item 2', preco: 15 },
    {nome: 'Item 3', preco: 20 },
  ];

  return (
    <div>
      <h1>Procedimentos</h1>
      <Table data={dados} />
    </div>
  );
};

export default VisualizarProcedimentos;
